import styled from 'styled-components';

const Container = styled.div`
  height:370px;
  width: 100vw;
  background: black;
  background-size: 100%;
  position: relative;
  overflow: hidden;
`;

const Logo = styled.div`
  height: 100vh;
  justify-content: center;
  display: flex;
`;

const BoxFooter = styled.div`
  width: ${props => props.width};
  display: flex;
  justify-content: ${props => props.center ? props.center: "block"}
`

export {
  Container,
  Logo,
  BoxFooter
}
